import React, {ReactElement} from 'react';
import ReactDOM from 'react-dom/client';
// import App from './App/App';
import './index.css';

function withComponent(WrappedComponent : (props : Saludador) => ReactElement) {
    return function RealComponent(props : Saludador) {
        return (
            <>
                <WrappedComponent {...props} />
                <p> Estamos acompa√±ando al WrappedComponent </p>
            </>);
    }
}
interface Saludador {
    saludo : string,
    nombre : string,
}

function App(props : Saludador) {
    return <h1> {props.saludo} {props.nombre}! </h1>;
}

const AppWithComponent  : (props : Saludador) => ReactElement = withComponent(App);

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <AppWithComponent saludo="Hola" nombre="mundo"/>
  </React.StrictMode>
);
